import React from "react";

function Signup() {
  return (
    <div className="container">
      <h1>Sign Up</h1>
      <form>
        <div>
          <label htmlFor="name">Name</label>
          <input type="text" />
        </div>
      </form>
    </div>
  );
}

export default Signup;
